import React from 'react'

import Navbar from './Navbar.jsx'

export default function About(props) {
    const skills = [
        ['Front-end', 'React', 'JavaScript', 'HTML5', 'CSS3'],
        ['Back-end', 'Node.js', 'Express'],
        ['Databases', 'MongoDB'],
        ['Tools', 'Git', 'Heroku'],
        ['Languages', 'JavaScript', 'C#', 'Python'],
    ]

    const education = [
        ['B.Sc in Computer Science', '2014 - 2018', 'With coursework in Computer Science, Mathematics, and Physics.'],
        ['Full stack Development Certification', '2023 - 2024', 'SVCollege, Tel Aviv, Israel.'],
        ['Highschool Diploma', '2014 - 2018', 'With coursework in Computer Science, Mathematics, and Physics.']
    ]

    const displaySkills = () => {
        return (
                <div className='skills'>
                    {
                        skills.map((arr) => {
                            return (
                                <div className='col'>
                                    <div className='sectionTitle'>{arr[0]}</div>
                                    <div className='line'></div>
                                    <ul>
                                    {
                                        arr.map((el, id) => {
                                            if (id != 0) {
                                                return (
                                                    <li>{el}</li>
                                                )
                                            }
                                        })
                                    }
                                    </ul>
                                    </div>
                            )
                        })
                    }
                </div>
        )
    }

    const displayEducation = () => {
        return (
                <div className='skills'>
                    {
                        skills.map((arr) => {
                            return (
                                <div className='col'>
                                    <div className='sectionTitle'>{arr[0]}</div>
                                    <div className='line'></div>
                                    <ul>
                                    {
                                        arr.map((el, id) => {
                                            if (id != 0) {
                                                return (
                                                    <li>{el}</li>
                                                )
                                            }
                                        })
                                    }
                                    </ul>
                                    </div>
                            )
                        })
                    }
                </div>
        )
    }

    return (
        <div className='About'>
            <div className='con'>
                <div className='col'>
                    <div className='row'>
                        <Navbar />
                    </div>

                    <div className='row'>
                        <span className='displayHeading'>
                            About
                        </span>
                    </div>

                    <div className='row'>
                        <span className='mainHeading'>
                            Technical Skills
                        </span>
                    </div>

                    <div className='row'>
                        {displaySkills()}
                    </div>

                    <div className='row'>
                        <span className='mainHeading'>
                            Education
                        </span>
                    </div>

                    <div className='row'>
                        <span className='mainHeading'>
                            Biography
                        </span>
                    </div>
                </div>
            </div>
        </div>
    )
}
